        if ($(""#refresh-input"").val() <= 0) {
            showWarning(""刷新时间必须大于0"");
            return;
        }
        clearInterval(interval);
        var min = $(""#refresh-input"").val() * 60 * 1000;
        interval = setInterval(function () {
            updateChart();
        }, min);
        showSuccess(""页面刷新时间设定完成，每 "" + $(""#refresh-input"").val() + "" 分钟刷新一次"");
    }

